(function(global){

    /*

        Example simple Visualiser class

    */

    var SmileyVisualiser = function() {

        // stores the current volume
        this.currentVolume = 0;

        // stores the current beat envelope / value
        this.currentBeatValue = 0;

        this.beatHist = [];

        // this.sides = [];

        this.lastTimestamp = Date.now();
        this.currentComposite = 'source-in';

        this.currentXScale = 3;
        this.currentYScale = 3;

        this.lastScaleTimestamp = Date.now();
        this.scaleChangeVal = -1;

        // this.percent = 0;
        // this.percentDirection = .8;
        this.snakeImg = new Image();
        // this.snakeImg.src = 'data:image/png;base64,';
        // this.snakeImg.src = 'data:image/png;base64,';
        this.snakeImg.src = 'data:image/png;base64,';
    }

    var p = SmileyVisualiser.prototype = new HarpaVisualiserBase();

    SmileyVisualiser.NOTE_HIST_LENGTH = 20;
    SmileyVisualiser.SWITCH_COLOR_MODE = 5000;
   
  

    p.render = function() {

        this.frontCtx.save();

        var scaledHeight = 1 - (this.currentVolume / 20000);
        scaledHeight = Math.min(1, scaledHeight);

        
        
        this.frontCtx.clearRect(0,0,this.faces.front.width,this.faces.front.height);
       
        var dx = 0;
        var dy = 0;
        var dw = this.snakeImg.width;
        var dh = this.snakeImg.height;
        var sx = -this.faces.front.width/4;
        var sy = -this.faces.front.height/4;
        var sw = this.faces.front.width/2;
        var sh = this.faces.front.height/2;
        this.frontCtx.save();
        this.frontCtx.translate(this.faces.front.width/2 - 15 * this.currentBeatValue, this.faces.front.height/2 + 15 * this.currentBeatValue);
        // this.frontCtx.scale(1 * this.currentBeatValue + 1, 1 * this.currentBeatValue + 1);
        this.frontCtx.scale(this.currentXScale + 2 * this.currentBeatValue, this.currentYScale + 1 * this.currentBeatValue);
        // this.frontCtx.rotate()

        this.frontCtx.drawImage(this.snakeImg, dx, dy, dw, dh, sx, sy, sw, sh);
        this.frontCtx.restore();

        this.frontCtx.save();
        this.frontCtx.translate(this.faces.front.width/2 + 15 * this.currentBeatValue, this.faces.front.height/2 - 15 * this.currentBeatValue);
        // this.frontCtx.scale(1 * this.currentBeatValue + 1, 1 * this.currentBeatValue + 1);
        this.frontCtx.scale(this.currentXScale - 2 * this.currentBeatValue, this.currentYScale - 1 * this.currentBeatValue);
        // this.frontCtx.rotate()

        this.frontCtx.drawImage(this.snakeImg, dx, dy, dw, dh, sx, sy, sw, sh);
        this.frontCtx.restore();
        

        
        var r = Math.round(255 * scaledHeight);
        var g = Math.round(200 * Math.random());
        var b = Math.round(200 * this.currentBeatValue);
       
        // console.log(scaledHeight);
        
        var now = Date.now();
        var diff = now - this.lastTimestamp;
        if (diff > SmileyVisualiser.SWITCH_COLOR_MODE){
            if (this.currentComposite == 'source-in')
                this.currentComposite = 'multiply';
            else
                this.currentComposite = 'source-in';

            this.lastTimestamp = now;

            // this.currentXScale += .1;
            // this.currentYScale += .2;

            // if (this.currentXScale > 5)
            //     this.currentXScale = 1;

            // if (this.currentYScale > 7)
            //     this.currentYScale = 1;
        }

        diff = now - this.lastScaleTimestamp;
        if (diff > 200){
            this.currentXScale += this.scaleChangeVal;
            this.currentYScale += this.scaleChangeVal;

            if (this.currentXScale < 1.5){
                this.scaleChangeVal = .1;

            }else if (this.currentXScale > 4){
                this.scaleChangeVal = -.1;
            }

            if (this.currentYScale < 1.5){
                this.scaleChangeVal = .1;
            }else if (this.currentYScale > 4){
                this.scaleChangeVal = -.1;
            }

            this.lastScaleTimestamp = now;
        }

        
        this.frontCtx.globalCompositeOperation = this.currentComposite;
        this.frontCtx.fillStyle = 'rgba('+r+', '+g+', '+b+', 1)';
        this.frontCtx.fillRect(0,0,this.faces.front.width, this.faces.front.height);
        // this.frontCtx.save();
        // this.frontCtx.translate(this.faces.front.width/2, this.faces.front.height/2);
        // this.frontCtx.scale(1.2, .5);
        // this.frontCtx.restore();

        this.frontCtx.restore();

        this.renderSide();
    };

    p.renderSide = function(){

        var scaledHeight = 1 - (this.currentVolume / 20000);
        scaledHeight = Math.min(1, scaledHeight);

        this.sideCtx.save();

        this.sideCtx.clearRect(0,0,this.faces.side.width, this.faces.side.height);

        var dx = 0;
        var dy = 0;
        var dw = this.snakeImg.width;
        var dh = this.snakeImg.height;
        var sx = -this.faces.side.width/8;
        var sy = -this.faces.side.height/8;
        var sw = this.faces.side.width/6 + 5 * this.currentBeatValue;
        var sh = this.faces.side.height/2;
        this.sideCtx.save();
        
        // this.sideCtx.save();
        var yAnimation = (3 - this.currentYScale) -  5 * this.currentBeatValue;
        var xAnimation = 20 + 10 * this.currentBeatValue;
        this.sideCtx.translate(xAnimation, yAnimation);
        var sideXScale = 4;
        var sideYScale = 4;
        this.sideCtx.scale(sideXScale,sideYScale);
        // this.sideCtx.scale(this.currentXScale + 2 * this.currentBeatValue, this.currentYScale + 1 * this.currentBeatValue);
        // this.frontCtx.rotate()
        this.sideCtx.drawImage(this.snakeImg, dx, dy, dw, dh, sx, sy, sw, sh);
        this.sideCtx.restore();

        var r = Math.round(255 * 1);
        var g = Math.round(200 * 1);
        var b = Math.round(200 * 1);


        this.sideCtx.globalCompositeOperation = this.currentComposite;
        this.sideCtx.fillStyle = 'rgba('+r+', '+g+', '+b+', 1)';
        this.sideCtx.fillRect(0,0,this.faces.front.width, this.faces.front.height);

        this.sideCtx.restore();
    };

    p.signal = function(channel, value) {

        // store volume values from channel 1
        if (channel == 1){
            this.currentVolume = value;
        }

        // store beat values from channel 2
       if (channel == 2){
            this.currentBeatValue = value;
            this.beatHist.unshift(value);
            if (this.beatHist.length > SmileyVisualiser.NOTE_HIST_LENGTH)
                this.beatHist.pop();
        }
    };


    global.SmileyVisualiser = (global.module || {}).exports = SmileyVisualiser;

})(this);
